import React from "react";

import MoviesList from "./components/MoviesList";
import "./App.css";

function App() {
  const fetchMoviHandler = () => {
    fetch("https://swapi.dev/api/films")
      .then((response) => {
        response.json();
      })
      .then((data) => {
        console.log(data.results);
      });
  };
  return (
    <React.Fragment>
      <section>
        <button onClick={fetchMoviHandler}>Fetch Movies</button>
      </section>
      <section>
        <MoviesList movies={[]} />
      </section>
    </React.Fragment>
  );
}

export default App;
